<div class="grand-seiko">
<p style="font-size:14px;line-height:150%;color: #fff;">
スプリングドライブGMT。セイコー独自の次世代キャリバー“スプリングドライブ”にGMT機能を付加しました。
スプリングドライブはぜんまいのほどける力を動力源としながらクオーツと同等の高精度を持つセイコー独自の画期的な駆動機構。流れるように動くスイープの秒針が特徴的です。細密なパターンが施された白い文字板に、ブルースチールの24時針が爽快でクールな印象です。ぜんまい駆動でありながら高精度なスプリングドライブには、秒針の動きを止めることなく第2タイムゾーンの時刻を知ることのできるGMT機能は正にふさわしい機能です。<br>
幾面もザラツ研磨が施され、光り輝く大胆なフォルムのスプリングドライブGMT。2つの時間を操り、世界を駆け巡るあなたの腕に似合います。 </p>

